import { useLocation } from "react-router-dom";
import Main from "../components/Main";

function HomePage() {
  const location = useLocation();

  useEffect(() => {
    fetchData();
  }, [location.key]);

  return (
    <>
      <Main />
    </>
  );
}

export default HomePage;
